import React from 'react';

const Shift = (props) => {
    return (
        <section className="box">
            <div className="shift">
                <p>Shift</p>
                <select onChange={props.changed} value={props.delta} name="delta">
                    {[...Array(5).keys()].map( i => (
                        <option key={i} value={i+1}>{i+1}</option>
                    ))};
                </select>
            </div>
        </section>
    );
}

export default Shift;
